import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import calculators from "../data/calculators"; // Adjust the relative path if needed
import "./Calculator.css";

function Calculator() {
  return (
    <div>
      {/* Navbar - same as App.js */}
      <div className="navbar">
        <div className="navbar-left">
          <h1>My Portfolio</h1>
        </div>
        <div className="navbar-right">
          <Link to="/">Home</Link>
          <Link to="/Calculator">Calculator</Link>
          <Link to="/ContactUs">Contact Us</Link>
          <Link to="/AskUs">Ask Us</Link>
          <Link to="/Market">Market</Link>
          <Link to="/Login">Login</Link>
          <Link to="/Signup">Sign Up</Link>
        </div>
      </div>

      {/* Calculator content */}
      <div className="container">
        {calculators.map((calc, index) => (
          <div className="image-grid" key={index}>
            <img src={calc.img} alt={calc.label} />
            <div className="middle">
              <Link to={calc.link}>
                <button>Launch Calculator</button>
              </Link>
            </div>
            <p className="caption">{calc.label}</p>
          </div>
        ))}
      </div>

      {/* Routes inside Calculator */}
      <Routes>
        {calculators.map((calc, index) => (
          <Route key={index} path={calc.link} element={<h1>{calc.label} Page</h1>} />
        ))}
      </Routes>
    </div>
  );
}

export default Calculator;
